import React from 'react';
import './LoginForm.css';

function LoginForm() {
  return (
    <div className="LoginForm">
        <p>ΣΥΝΔΕΣΗ</p>
        <form id='user-form'>
              Δ/νση ηλεκτρονικού ταχυδρομείου <br/>
              <input type = "text" placeholder = 'Enter name'    value = {this.state.name}    onChange = {this.onNameChange}/>   <br/>
              Κωδικός πρόσβασης<br/>
              <input type = "text" placeholder = 'Enter email'   value = {this.state.email}   onChange = {this.onEmailChange}/>  <br/>

          </form>
    </div>
  );
}

export default LoginForm;
